    console.log(`read firestore`)
    rows.push(<TaskRow displayText={text} id={id}/>);
    console.log(`Number of rows rendered: ${rows.length}`)
})
const TaskList = () => {
    return (
        <div>
            {rows}
        </div>
    );
}

export default TaskList;
